(1, 'Webinar Interaktif: \"Membangun Keterampilan Abad 21\"', 'Webinar ini akan mengundang para ahli di bidang pendidikan dan pengembangan karir untuk membahas keterampilan yang diperlukan di era digital saat ini. Peserta akan diajak berinteraksi melalui sesi tanya jawab langsung, polling, dan diskusi kelompok kecil. Dengan topik yang relevan seperti keterampilan komunikasi, kolaborasi, dan pemecahan masalah, peserta akan mendapatkan wawasan praktis yang dapat diterapkan dalam kehidupan sehari-hari dan dunia kerja. Acara ini juga akan dilengkapi dengan materi yang dapat diunduh dan akses ke rekaman untuk peserta yang tidak dapat hadir secara langsung.', 'Universitas Brawijaya', , '2024-12-15', '2024-12-20');
INSERT INTO `acara` (`id_acara`, `judul`, `deskripsi`, `lokasi`, `gambar`, `dimulai_pada`, `berakhir_pada`) VALUES
(3, 'Workshop Keterampilan: \"Desain Grafis untuk Pemula\"', 'Dalam workshop ini, peserta akan belajar dasar-dasar desain grafis menggunakan perangkat lunak populer seperti Canva atau Adobe Illustrator. Acara ini akan dipandu oleh seorang desainer profesional yang akan memberikan tutorial langkah demi langkah tentang cara membuat poster, infografis, dan materi pemasaran lainnya. Peserta akan diajak untuk berlatih secara langsung dan mendapatkan umpan balik tentang karya mereka. Di akhir workshop, peserta akan memiliki portofolio kecil yang dapat digunakan untuk melamar pekerjaan atau proyek freelance.', 'Universitas Madura', , '2024-12-18', '2024-12-30');

